import React from 'react';

const JayaRank = () => {
    return (
        <div className='px-32 '>
           <div className='flex mt-6 rounded-md text-white space- flex-col  justify-center bg-green-600 items-center '>
           <div>
           <h3>Login / register now become JAYA9 VIP</h3>
           <p className='text-center'>Get the Benefits Now</p>
           </div>
            <div className='flex flex-row gap-32  justify-between'>
            <button
              className="border border-white bg-common-blue px-4 py-2 hover:border-orange-500 outline-none rounded-sm text-white"
            >
              প্রবেশ করুন
            </button>

            <button className="bg-common-orange px-8  py-2 rounded-sm">
              নিবন্ধন
            </button>
            </div>
           </div>
        </div>
    );
};

export default JayaRank;
